	(5477, 253, 'text', 'Today, Seatback is a holistic wellness solution that encourages and motivates people to reach their health goals by tracking their sitting habits. Through the use of innovative proprietary sensors, a digital app, and integration with smart watches, Seatback promotes physical awareness, prevents health problems caused by a sedentary lifestyle, bad posture, and prolonged sitting , and helps users lead more dynamic lives.'),
