	(7, 1, '2020-05-01 10:54:51', '2020-05-01 10:54:51', 'a:7:{s:8:"location";a:1:{i:0;a:1:{i:0;a:3:{s:5:"param";s:9:"page_type";s:8:"operator";s:2:"==";s:5:"value";s:10:"front_page";}}}s:8:"position";s:6:"normal";s:5:"style";s:7:"default";s:15:"label_placement";s:3:"top";s:21:"instruction_placement";s:5:"label";s:14:"hide_on_screen";a:1:{i:0;s:11:"the_content";}s:11:"description";s:0:"";}', 'Main', 'main', 'publish', 'closed', 'closed', '', 'group_5eabffc5b5d06', '', '', '2020-05-26 10:27:41', '2020-05-26 10:27:41', '', 0, 'https://seatback-admin.webbuilder.in.ua/?post_type=acf-field-group&#038;p=7', 0, 'acf-field-group', '', 0),
