	(211, 1, '2020-05-16 09:46:26', '2020-05-16 09:46:26', '<!-- wp:paragraph -->\r\n<p>We hear all the time that “sitting is killing us” and “sitting is the new smoking”. We know that sitting for too long is not healthy and can increase risk factors for several health issues. But wait “I exercise twice a week at the gym“ or I run 3 times a week….” Will that help me fight the sitting disease?</p>\r\n<h2>It sure will help! But it’s not enough.</h2>\r\n<p>Experts tells us that even if you are hitting all your physical activity goals, but remain seated 8 or more hours a day, you can’t undo the negative effects of too much sitting. Accordingly, we must create ways for all of us to continually move more throughout the day.</p>\r\n<h2>Moving in the office can be accomplished in a few ways:</h2>\r\n<ol>\r\n<li>Coordinate “walking meetings” where we - walk &amp; talk. It will increase blood flow and the body’s metabolism and can help creativity.</li>\r\n<li>Every time the phone rings, whether it’s your spouse or your boss, stand up!<br /><img class="alignnone size-medium wp-image-199" src="https://seatback-admin.webbuilder.in.ua/wp-content/uploads/2020/05/jim-reardan-gyslVZcsNK4-unsplash-300x106.png" alt="" width="300" height="106" /></li>\r\n<li>Once every hour get up for a quick walk in the office, or even better - go down or up one floor and come back.</li>\r\n<li>Drink from small glasses, so you’l have to refill frequently.</li>\r\n<li>Use the toilets that are further away from your office.</li>\r\n<li>Replace e-mail with face-to-face meetings with your colleagues.<br /><img class="alignnone size-medium wp-image-194" src="https://seatback-admin.webbuilder.in.ua/wp-content/uploads/2020/05/chris-curry-yREPfEjt8iE-unsplash-300x106.png" alt="" width="300" height="106" /></li>\r\n<li>Send your prints to a distant printer, or even on an upper floor.</li>\r\n<li>Download a reminder tool to your cellphone or computer, it will help get up &amp; move.</li>\r\n<li>Use a stretching guide to relive tension and give you a boost of energy.</li>\r\n</ol>\r\n<!-- /wp:paragraph -->', 'Article Headline', '', 'inherit', 'closed', 'closed', '', '210-revision-v1', '', '', '2020-05-16 09:46:26', '2020-05-16 09:46:26', '', 210, 'https://seatback-admin.webbuilder.in.ua/210-revision-v1/', 0, 'revision', '', 0),
