	(531, 1, '2020-05-28 13:06:20', '2020-05-28 13:06:20', 'When Seatback Co-Founder Sigal Lustig started her physical therapy practice, she noticed a lot of her patients had similar musculoskeletal afflictions. They complained of neck pain, back pain, and carpal tunnel syndrome. Upon investigation, she learned that most of these patients had one thing in common - they were leading sedentary lifestyles. They weren’t using their bodies properly, and they were suffering because of it.\r\n\r\nSigal turned to her husband (and eventual Co-Founder) Or, a mechanical engineer. She asked him to design a chair that motivated people to increase their sitting quality. He developed a prototype and Seatback was born.\r\nSoon, Sigal and Or expanded Seatback into a SaaS platform and assembled a team of engineers and health professionals to help them collect and interpret data.', 'About', '', 'inherit', 'closed', 'closed', '', '253-revision-v1', '', '', '2020-05-28 13:06:20', '2020-05-28 13:06:20', '', 253, 'https://seatback-admin.webbuilder.in.ua/blog/253-revision-v1/', 0, 'revision', '', 0),
